import React from 'react';
import SectionButton from './SectionButton';


const Nameblock = ({ children }) => {

    return (
        <h1>
            <div id="nameblock">
                    <div id='firstname'>Collin</div>
                    <div id="lastname">Sparks</div>
                    <div className="section-buttons">
                        {children}
                    </div>
            </div>
        </h1>
    );
};

export default Nameblock;
